import React, { Component } from 'react'
import Cwbstation from './Cwbstation'
const makeStation=(stas)=>{
    const sta=stas["records"];
    var output=[];
    for(let i=0;i<sta.length;++i)
        output.push(<Cwbstation station={sta} />)
    return output;
}
export class Cwbdata extends Component {
    constructor(props) {
        super(props);
        this.stationData=props.stations
      };
    render() {
        return (
            <div>
                {
                makeStation(this.stationData)
                }
            </div>
        )
    }
}
export default Cwbdata
